export default {
  name: "storage-path-breadcrumb",
  props: {
    parts: {
      type: Array,
      required: true
    },
    rootName: {
      type: String,
      default: "Home"
    }
  },
  computed: {
    items: function items() {
      var _this = this;

      var subparts = [];
      var partsItems = this.parts.map(function (part, index) {
        subparts.push(part);
        return {
          text: part,
          path: subparts.join("/"),
          active: index === _this.parts.length - 1
        };
      });
      return [{
        text: this.rootName,
        path: "",
        active: this.parts.length === 0
      }].concat(partsItems);
    }
  },
  methods: {
    directorySelected: function directorySelected(path) {
      this.$emit("directory-selected", path);
    }
  }
};
